const DiscordOauth2 = require("discord-oauth2");
const oauth = new DiscordOauth2();

export const login = () => {
  let code = "UBYWC6Zp3QmKgmIQjjvus3SS9e7X8t";
  oauth
    .tokenRequest({
      clientId: "687765988636229689",
      clientSecret: "M7xSfiqX7xqn6j4YUiHVeS9ohOdo6-1M",
      code: code,
      scope: "identify email",
      grantType: "authorization_code",
      redirectUri: "https://cuttingdiesstore.com"
    })
    .then(console.log);
};

const getUser = () => {
  let token = "X29BAOUckfRYitM4zfYqjcVHSONRXy";
  oauth.getUser(token).then(console.log);
};
